import React, { useState, useEffect, Component } from 'react'
import axios from 'axios'
import { FormGroup, Input, Button, Alert } from 'reactstrap'
import { BrowserHistory } from 'react-router-dom'
import { Link, NavLink } from "react-router-dom"
import styled from 'styled-components'
import img1 from "../Assets/login.gif"
import img2 from "../Assets/cb.png"

const Form = styled.form`
  max-width: 800px;
  height: 100%;
  display: flex;
  flex-flow: row wrap;
  margin: 60px auto;
  border: 2px solid black;
  padding: 10px;

  h3{
    text-align: center;
  }

  img{
    width: 200px;
    transition: 0.4s;
  }
  img:hover{
    filter: invert(100%);
  }

  #desc{
    width: 100%;
  }

  .form-group{
    width: 170px;
  }

  FormGroup {
    border:solid;
    margin: 150px;
    width: 200px;
  }
  FormGroup:nth-child(1) {
    margin-bottom:auto;
    margin-right:auto;
    order:0;
  }
  FormGroup:nth-child(2) {
    margin-bottom:auto;
    margin-left:auto;
    order:0;
  }

  FormGroup:nth-child(3) {
    margin-top:auto;
    margin-right:auto;
    order:2;
  }
  FormGroup:nth-child(4) {
    margin-top:auto;
    margin-left:auto;
    order:2;
  }
`


export default function Shop() {

  return (
    <Form style={{ padding: '40px' }} >

      <h3>Shop Premade Bots</h3>

      <p><center>Choose from various <b>Bots</b> below.</center></p>

      <FormGroup>
          <legend>SupremeDM</legend>
          <img src={img2} alt="SupremeDM"/>
          <br/>
          <a href='https://www.fatfreecartpro.com/i/zwdt?card' style={{"display":"inline-block","background":"rgb(40, 167, 69) url(https://www.e-junkie.com/ej/images/newviewproduct.png) center/110px no-repeat","border":"none","padding":"7px 98px","borderRadius":"3px","textDecoration":"none"}}>&nbsp;</a>
          <p id="desc">
            Hey #Instagrammers Check out #SupremeDM!
            Continue or Start your #instagram messages from your PC, Share Video, Voice Notes & Photo's, Manage users who don't Follow Back & More! A great tool for business!
            SupremeDM Currently only available for #Windows OS
          </p>
      </FormGroup>

      <FormGroup>
          <legend>SupremeGram v1 - v2</legend>
          <img src={img2} alt="SupremeDM"/>
          <br/>
          <a href='https://www.fatfreecartpro.com/i/zwdt?card' style={{"display":"inline-block","background":"rgb(40, 167, 69) url(https://www.e-junkie.com/ej/images/newviewproduct.png) center/110px no-repeat","border":"none","padding":"7px 98px","borderRadius":"3px","textDecoration":"none"}}>&nbsp;</a>
      </FormGroup>

      <FormGroup>
          <legend>AMFaster v1</legend>
          <img src={img2} alt="SupremeDM"/>
          <br/>
          <a href='https://www.fatfreecartpro.com/i/zwdt?card' style={{"display":"inline-block","background":"rgb(40, 167, 69) url(https://www.e-junkie.com/ej/images/newviewproduct.png) center/110px no-repeat","border":"none","padding":"7px 98px","borderRadius":"3px","textDecoration":"none"}}>&nbsp;</a>
      </FormGroup>

    </Form>
  )

}
